import React from "react";
import { Box, Image } from "./style";
import DioLogo from ""; 

export const Header = () => {
	return (
		<Box>
			<h1>Dio Bank</h1>
			<Image
				src="../../assets/DioLogo.png"
				alt=""
			/>
		</Box>
	);
};
